int is_prime(int num)
{
    if (num < 2)
        return 0;

    if (num < 4)
        return 1;

    if (num % 2 == 0)
        return 0;

    for (int i = 3; i * i <= num; i++)
    {
        if (num % i == 0)
            return 0;
    }
    return 1;
}

int is_semi_prime(int num)
{
    int i;
    int non_prime = 0;
    int divide_with_prime = 0;

    if (num < 4)
        return 0;

    for (i = 2; i * i <= num; i++)
    {
        if (num % i == 0)
        {
            // printf("i : %d, ", i);       // debug
            non_prime = 1;

            if (is_prime(i) == 1)
                divide_with_prime++;

            if (divide_with_prime > 1)
                return 0;
        }
    }

    if (non_prime == 1)
    {
        while (i <= num / 2)
        {
            if (num % i == 0)
            {
                if (is_prime(i) == 1)
                    divide_with_prime++;
                // printf("%d ", divide_with_prime);       // debug

                if (divide_with_prime > 1)
                    return 0;
            }
            i++;
        }
    }
    else
        return 0;
    return 1;
}

int main()
{
    int n;
    int a, b;
    int count = 0;
    scanf("%d", &n);
    for (int i = 0; i < n; i++)
    {
        scanf("%d%d", &a, &b);
        for (int j = a; j <= b; j++)
        {
            if (is_semi_prime(j) == 1)
            {
                // printf("%d, ", j); // debug
                count++;
            }
        }
        printf("%d\n", count);
        count = 0;
    }
    // printf("%d ", is_semi_prime(n));     // debug
    return 0;
}
